import { Stack, TextField } from "@mui/material";

const Form = () => {
  return (
    <Stack gap={3}>
      <TextField
        label="Number of Questions"
        variant="outlined"
        style={{ borderWidth: '10px', borderRadius: '4px' }} // Adjust border width and radius as needed
      />
      <TextField
        label="Category"
        variant="outlined"
        style={{ borderWidth: '2px', borderRadius: '4px' }}
      />
      <TextField
        label="Difficulty"
        variant="outlined"
        style={{ borderWidth: '2px', borderRadius: '4px' }}
      />
      <TextField
        label="Type"
        variant="outlined"
        style={{ borderWidth: '2px', borderRadius: '4px' }}
      />
    </Stack>
  );
};

export default Form;
